import React from "react";
import { useNavigate } from "react-router-dom";

function AllSites() {
    let navigate = useNavigate();

    return (
        <div>
        THIS IS THE SITES PAGE
        <button
            onClick={() => {
            navigate("/");
            }}
        >
            {" "}
            Home
        </button>
        <button
            onClick={() => {
            navigate("/sites/:site");
            }}
        >
            {" "}
            Site
        </button>
        </div>
    );
}

export default AllSites;
